<script lang="ts" setup>
import { ref,computed, onMounted, onBeforeUnmount } from 'vue';
import { IAsiento } from '../interfaces/Asiento';
const colorAsientoReservado = '#BB576F';
const colorAsientoApartado = '#DECD34';
const colorAsientoDisponible = '#78AC66'
const asientosSeleccionado = ref<IAsiento[]>([])

const propsComponente = defineProps({
    value:{
        type:Array<IAsiento>,
        required:true    
    },
    vueloId:{
        type:Number,
        required:true
    }
});
const emits = defineEmits<
{
    'update:value':[Array<IAsiento>]
}
>();

const event = (valor: any) => {
    asientosSeleccionado.value = internalValue.value;
    if (valor !== null && valor.target !== null && valor.target.attributes["id"]) {
        const fill = valor.target.attributes["fill"];
        const id = valor.target.attributes["id"];
        if (fill.value === colorAsientoDisponible && fill.vallue !== colorAsientoReservado) {
            fill.value = colorAsientoApartado;
            const asiento:IAsiento ={
                asientoId: parseInt(id.value),
                esApartado:true,
                esReservado:false,
                vueloId:propsComponente.vueloId,
                vueloAsientoId:0,
                fechaApartado:""
            }

            asientosSeleccionado.value.push(asiento);
            internalValue.value = asientosSeleccionado.value ;
        } else if (fill.value === colorAsientoApartado && fill.vallue !== colorAsientoReservado) {
            fill.value = colorAsientoDisponible;
            const index = asientosSeleccionado.value.findIndex((e) =>{return e === id.value});
            asientosSeleccionado.value.splice(index,1);
            internalValue.value = asientosSeleccionado.value;
        }

    } else {
        // alert('no es asietno');
    }
}

const internalValue = computed({
    get(){
        return propsComponente.value
    },
    set(value:Array<IAsiento>){
        emits('update:value',value);
    }
})
const pintaAsientosOcupados = () =>{
    if(internalValue.value && internalValue.value.length > 0){
        internalValue.value.forEach((e) =>{
            const element:any = document.querySelector("[id='"+e.asientoId+"']");   
            if(element){
                if(e.esApartado){
                    const fillAttribute:any = 'fill';
                    element.attributes[fillAttribute].value = colorAsientoApartado;
                }else if(e.esReservado){
                    const fillAttribute:any = 'fill';
                    element['classList'] = [];
                    element.attributes[fillAttribute].value = colorAsientoReservado;
                }
            }
        });
    }
}

const limpiaSeleccion = () =>{
const asientos = obtenerAsientosDom();
    if(asientos && asientos.length > 0){
        asientos.forEach((e:any)=>{
            const fillAttribute:any = 'fill'
            e.attributes[fillAttribute].value = colorAsientoDisponible;
            e['classList'].value = ['cursor-pointer'];
        });
    }
}
const obtenerAsientosDom = (): HTMLElement[] => {
    const allElements = document.querySelectorAll<HTMLElement>('*');

    const asientos = Array.from(allElements).filter(element => {
        const id = element.id;
        return /^[0-9]+$/.test(id);
    });
    
    return asientos;
};
onBeforeUnmount(() =>{
    limpiaSeleccion();
});

onMounted(() =>{
    pintaAsientosOcupados();
});
</script>